namespace AttuneLib;

public class AkaiFire
{

    public enum Button
    {
        SELECTOR = 26,
        PATTERN_UP = 31, PATTERN_DOWN = 32, BROWSER = 33, GRID_LEFT = 34, GRID_RIGHT = 35,
        MUTE_1 = 36, MUTE_2 = 37, MUTE_3 = 38, MUTE_4 = 39,
        STEP = 44, NOTE = 45, DRUM = 46, PERFORM = 47,
        SHIFT = 48, ALT = 49,

        ///<summary>colors: 1=LowG, 2=LowY, 3=G, 4=Y</summary>
        PATTERN = 50,

        ///<summary>colors: 1=LowG, 2=LowY, 3=G, 4=Y</summary>
        PLAY = 51,

        ///<summary>colors: 1=LowY, 2=Y</summary>
        STOP = 52,

        ///<summary>colors: 1=LowR, 2=LowY, 3=R, 4=Y</summary>
        RECORD = 53,
    }
    public enum Knob
    {
        Selector = 0,
        Knob1 = 1,
        Knob2 = 2,
        Knob3 = 3,
        Knob4 = 4,
    }

    const string AKAI_FIRE_MIDI_NAME = "FL STUDIO FIRE";

    private Attune attune;
    private MidiIn deviceIn;
    private MidiOut deviceOut;
    private Dictionary<int, bool> buttonsPoll = new Dictionary<int, bool>();

    AkaiFire()
    {
        foreach (Button button in Enum.GetValues(typeof(Button)))
        {
            buttonsPoll[(int)button] = false;
        }
    }

    internal static (AkaiFire, string) Create(Attune attune)
    {
        Dictionary<string, int> deviceInList = MidiConnect.listMidiIn();
        Dictionary<string, int> deviceOutList = MidiConnect.listMidiOut();
        if (!deviceInList.ContainsKey(AKAI_FIRE_MIDI_NAME) || !deviceOutList.ContainsKey(AKAI_FIRE_MIDI_NAME))
        {
            string inNames = string.Join(", ", deviceInList.Keys);
            string outNames = string.Join(", ", deviceOutList.Keys);
            return (null, "Unable to connect to " + AKAI_FIRE_MIDI_NAME + "\n" +
                "\nAvailable Midi Ins: " + inNames +
                "\nAvailable Midi Outs: " + outNames
            );
        }

        attune.LogDebug("\nDevice In Capabilites:");
        MidiInCapabilities deviceInCaps = MidiIn.DeviceInfo(deviceInList[AKAI_FIRE_MIDI_NAME]);
        attune.LogDebug(new List<PropertyInfo>(deviceInCaps.GetType().GetProperties()).Select(p => "\t" + p.Name + ": " + p.GetValue(deviceInCaps).ToString() + "\n").ToArray());
        attune.LogDebug("Device Out Capabilites:");
        MidiOutCapabilities deviceOutCaps = MidiOut.DeviceInfo(deviceOutList[AKAI_FIRE_MIDI_NAME]);
        attune.LogDebug(new List<PropertyInfo>(deviceOutCaps.GetType().GetProperties()).Select(p => "\t" + p.Name + ": " + p.GetValue(deviceOutCaps).ToString() + "\n").ToArray());

        AkaiFire fire = new AkaiFire();
        fire.attune = attune;
        fire.deviceIn = MidiConnect.HandleMidiIn(deviceInList[AKAI_FIRE_MIDI_NAME], (s, e) => fire.OnMessage(e.MidiEvent), attune.OnError, attune.OnSysex);
        fire.deviceOut = MidiConnect.GetMidiOut(deviceOutList[AKAI_FIRE_MIDI_NAME]);
        return (fire, "Connected to " + AKAI_FIRE_MIDI_NAME);
    }

    internal void OnMessage(MidiEvent e)
    {

        if (e is NoteEvent note)
        {

            //attune.LogDebugVerbose(DateTime.Now + ": ", note.CommandCode, note.NoteNumber);

            int n = note.NoteNumber;
            if (n >= (int)Button.SELECTOR && n <= (int)Button.RECORD)
            {
                buttonsPoll[n] = note is NoteOnEvent;
                if (buttonsPoll[n])
                    attune.OnButtonPressed((Button)Enum.ToObject(typeof(Button), n));
                else
                    attune.OnButtonReleased((Button)Enum.ToObject(typeof(Button), n));
            }

            if (n >= 54 && n <= 117)
            {
                int padIndex = n - 54;
                if (note is NoteOnEvent)
                    attune.OnPadPressed(padIndex, padIndex % 16, padIndex / 16);
                else
                    attune.OnPadReleased(padIndex, padIndex % 16, padIndex / 16);
            }
        }

        if (e is ControlChangeEvent ev)
        {
            int knobIndex = (int)ev.Controller == 118 ? 0 : (int)ev.Controller - 15;
            Knob knob = (Knob)Enum.ToObject(typeof(Knob), knobIndex);
            int knobAmount = ev.ControllerValue < 64 ? ev.ControllerValue : ev.ControllerValue - 128;
            attune.OnKnob(knob, knobAmount);
        }

    }

    //
    //
    //

    internal bool IsButtonDown(Button button)
    {
        return buttonsPoll[(int)button];
    }

    public void SetPadColor(int x, int y, int color)
    {
        byte[] msgData =  {
                0x47, 0x7F, 0x43, 0x65, // akai // allcall // fire // write pads
                0x00, 0x04, // payload size
                (byte)(y * 0x10 + x), // Pad index
                (byte)(color >> 17 & 0x7F),// r
                (byte)(color >> 9 & 0x7F), // g
                (byte)(color >> 1 & 0x7F)  // b
            };
        SendSysex(msgData);
    }

    //byte[] emptyMatrix = Enumerable.Repeat((byte)0, 128 * 64 / 8).ToArray();
    public void WriteOnScreen(int x, int y, string s, int size = 2)
    {
        PrepImg();
        WriteOnScreenBuffered(x, y, s, size);
        PrepImgSend();
    }

    public void WriteOnScreenBuffered(int x, int y, string s, int size = 2)
    {
        AkaiLetters.UseLetters(s, (dx, dy) =>
        {
            PrepImgPixel(x + dx, y + dy, true);
        });
    }

    public void WriteOnPads(string s, int color = 0xf0f0f0)
    {
        WriteOnAllPads(0);
        AkaiLetters.UseLetters(s, (dx, dy) =>
        {
            SetPadColor(dx, dy, color);
        });
    }

    public void WriteOnAllPads(int color)
    {
        for (int i = 0; i < 16; i++)
        {
            for (int j = 0; j < 4; j++)
            {
                SetPadColor(i, j, color);
            }
        };
    }

    public void WriteBitOnScreen(int x, int y, bool b)
    {
        PrepImg();
        PrepImgPixel(x, y, b);
        PrepImgSend();
    }

    byte[] prepMatrix;

    public void PrepImg()
    {
        var s = mutex.Length / 7;
        prepMatrix = new byte[s];
        for (int i = 0; i < prepMatrix.Length; i++)
            prepMatrix[i] = 0;
    }

    public void PrepImgPixel(int x, int y, bool b)
    {
        if (x < 0 || y < 0 || x >= 128 || y >= 64) return;

        int index = mutex[y, x];
        int matrixIndex = index / 7;
        if (matrixIndex >= prepMatrix.Length) return;
        int bitIndex = index % 7;
        if (b)
            prepMatrix[matrixIndex] |= (byte)(1 << bitIndex);
        else
            prepMatrix[matrixIndex] &= (byte)~(1 << bitIndex);
    }

    public void PrepImgSend()
    {

        int payloadLen = prepMatrix.Length + 4;
        byte payloadLenHigh = (byte)(payloadLen >> 7);
        byte payloadLenLow = (byte)(payloadLen & 0x7F);
        byte[] msgData =  {
                0x47, 0x7F, 0x43, 0x0E, // akai // allcall // fire // write to screen
                payloadLenHigh, payloadLenLow, // payload length high bits // payload length low bits
                0x00, 0x07, // Start 8-pixel band of update // End 8-pixel band of update (here, 8 bands of 8 pixels, i.e. the whole display)
                0x00, 0x7F, // Start colum of update // End column of update
            };
        SendSysex(msgData, prepMatrix);
    }

    public void LightAllButtons(int color = 0)
    {
        foreach (var button in Enum.GetValues(typeof(Button)))
        {
            LightButton((Button)button, color);
        }
    }

    internal void LightButton(Button button, int color)
    {
        SendControlMessage((byte)button, (byte)color);
    }

    internal void SendControlMessage(byte buttonIndex, byte color)
    {
        deviceOut.SendBuffer(new byte[] { 0xB0, buttonIndex, color });
    }

    internal void SendSysex(params byte[][] msgDatas)
    {
        deviceOut.SendBuffer(new byte[] { 0xF0 });
        foreach (var msgData in msgDatas)
            deviceOut.SendBuffer(msgData);
        deviceOut.SendBuffer(new byte[] { 0xF7 });
    }

    internal void Close()
    {
        deviceIn.Close();
        deviceOut.Close();
    }

